import { useContext } from "react";
import { Table } from "reactstrap";
import { DivHeaderTable, TR } from "./style";
import { Context } from "../../hooks/DataProvider";

const Tables = () => {
  const { file, setFile } = useContext(Context);

  const data = file.data;

  function toObject(arr) {
    var rv = {};
    for (var i = 0; i < arr.length; ++i) rv[i] = arr[i];
    return rv;
  }

  return (
    <>
      <DivHeaderTable>
        <div className="child-1">38</div>
        <div className="child-2">
          listings successfully and Ready to published
        </div>
        <div className="child-3">
          <i className="fas fa-history"></i> Update data
        </div>
        <div className="child-4">
          <i className="far fa-window-maximize" />
        </div>
        <div className="child-5">Published</div>
      </DivHeaderTable>
      <Table responsive>
        <thead>
          <tr>
            <th></th>
            <th>CONDO NAME</th>
            <th>RENT PRICE (Baht)</th>
            <th>SELL PRICE (Baht)</th>
            <th>BEDROOM</th>
            <th>BATHROOM</th>
            <th>SIZE (sqm.)</th>
            <th>FLOOR </th>
            <th>STATUS </th>
            <th>PHOTO </th>
            <th>TITLE </th>
            <th>DESCRIPTION </th>
            <th>BENEFIT </th>
            <th>Amenities </th>
          </tr>
        </thead>
        <tbody>
          {data.map((file, index) => {
            const object = { ...file };
            if (index > 0) {
              return (
                <>
                  <TR>
                    <th scope="row">{object["0"]}</th>
                    <th>{object["1"]}</th>
                    <th>{object["2"]}</th>
                    <th>{object["3"]}</th>
                    <th>{object["4"]}</th>
                    <th>{object["5"]}</th>
                    <th>{object["6"]}</th>
                    <th>{object["7"]}</th>
                    <th>{object["8"]}</th>
                    <th>{object["9"]}</th>
                    <th>{object["10"]}</th>
                    <th>{object["11"]}</th>
                    <th>{object["12"]}</th>
                    <th>{object["13"]}</th>
                  </TR>
                </>
              );
            }
          })}
        </tbody>
      </Table>
    </>
  );
};

export default Tables;
